import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "./components/Header";
import MovieList from "./components/MovieList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <MovieList />
      </header>
    </div>
  );
}

export default App;
